import { BrowserRouter } from "react-router-dom";
import CardMediaSimple from "./components/organisms/CardMediaSimple/CardMediaSimple";
import FloatingLabelInput from './components/atoms/InputText/FloatingLabelInput';
import InputPass from "./components/atoms/InputWithIcon/InputPass";

function App() {
  const img = "/assets/icons/Bitmap.svg";
  return (
    <BrowserRouter>
      <div>
      <CardMediaSimple imageUrl={img}/>
        <br />
        <CardMediaSimple />
        <br />
        <FloatingLabelInput labelText="Email" placeholderText="email@email.com"/> 
        <InputPass placeholderText="Password"/>
      </div>
    </BrowserRouter>
  );
}

export default App;
